	function CalculationOfTiles() {
		//alert(1);
		var unit = 'm<sup>2</sup>';
		var ft = 'ft<sup>2</sup>';
		var baseWidth = parseFloat(document.getElementById('fieldBase').getAttribute("width"));
		var baseHeight = parseFloat(document.getElementById('fieldBase').getAttribute("height"));
		var mainFieldWidth = parseFloat(document.getElementById('fieldLine').getAttribute("width"));
		var mainFieldHeight = parseFloat(document.getElementById('fieldLine').getAttribute("height"));
		var totalArea= baseWidth * baseHeight;		
		var fieldArea= mainFieldWidth * mainFieldHeight;
		var aroundArea= totalArea - fieldArea;
		var totalNumberTiles = totalArea * 11;
		var fieldNumberTiles = fieldArea * 11;
		var aroundNumberTiles = aroundArea * 11;
		
		if (document.getElementById("togBtnUnit").value == "m") {
			
			return document.getElementById('TotalArea').innerHTML = totalArea.toFixed(2) + " " + unit ;	
		} else {
			return document.getElementById('TotalArea').innerHTML = totalArea.toFixed(2) + " " +  ft;
		}
	}
	
