			document.getElementById("bergoCourt").classList.remove('bergoCourt3d');	
			$('#goal-left').css('display', 'none');
			$('#goal-right').css('display', 'none');
			$('#hoop-left').css('display', 'none');
			$('#hoop-right').css('display', 'none');
		} else {
			document.getElementById("togBtn").setAttribute("value", "3d");
			document.getElementById("bergoCourt").classList.add('bergoCourt3d');
			$('#bergoCourt').css('-moz-transform',"matrix3d(1,-0.03,0.00,0,-0.03,0.5,0.87,-0.001,0,-0.87,0.5,0,-300,140,0,1)");

			if (document.getElementById("togBtnGoals").value == "on") {
				$('#goal-left').css('display', 'block');
				$('#goal-right').css('display', 'block');
			}
			if (document.getElementById("togBtnHoops").value == "on") {
				var e = document.getElementById("select");
				var selectedField = e.options[e.selectedIndex].value;
