	function rotateField(rotateLine, rotateColor, rotateKey, toogleId) {
		var coord = $('#'+rotateLine)[0].getBBox();
		//alert(coord.x + " " + coord.y + " " +coord.width + " " + coord.height);
		var rotateX = (coord.width/2)+coord.x;
		var rotateY = (coord.height/2)+coord.y;
		//alert(rotateX + " " + rotateY);
		
		if (document.getElementById(toogleId).value == "0") {
			
			document.getElementById(toogleId).setAttribute("value", "90");
			
			//rotate optional field by 90 degree 
			var rotateAll = "rotate(90," + rotateX + "," + rotateY + ") "
				document.getElementById(rotateLine).setAttribute("transform", rotateAll );
				document.getElementById(rotateColor).setAttribute("transform", rotateAll );
				document.getElementById(rotateKey).setAttribute("transform", rotateAll );
			
	  } else {
			document.getElementById(toogleId).setAttribute("value", "0");
			
			//rotate optional field by 0 degree 
			var rotateAll = "rotate(0," + rotateX + "," + rotateY + ")"
				document.getElementById(rotateLine).setAttribute("transform", rotateAll );
				document.getElementById(rotateColor).setAttribute("transform", rotateAll );
				document.getElementById(rotateKey).setAttribute("transform", rotateAll );						
		}
	}
	
