		function changeSpread(dimension, coordinate, newValue, aroundDirection, spreadDirection, opositeAroundDirection, opositeSpreadDirection, mainFieldDimension){
			var valueFromInput = parseFloat(+newValue);			
			var totalSize = parseFloat(document.getElementById('fieldBase').getAttribute(dimension));
			var fieldSize = parseFloat(document.getElementById('fieldLine').getAttribute(dimension));
			var differenceInSize = round(totalSize-fieldSize,1); 
			var opositeSpreadValue = round(differenceInSize - valueFromInput,1);
			
			
				document.getElementById(aroundDirection).value= valueFromInput;
				document.getElementById(aroundDirection).setAttribute('value', valueFromInput);
				document.getElementById(spreadDirection).value= valueFromInput;
				document.getElementById(spreadDirection).setAttribute('value', valueFromInput);
				
				document.getElementById(opositeAroundDirection).value= opositeSpreadValue;
				document.getElementById(opositeAroundDirection).setAttribute('value', opositeSpreadValue);
				document.getElementById(opositeSpreadDirection).value= opositeSpreadValue;
				document.getElementById(opositeSpreadDirection).setAttribute('value', opositeSpreadValue);
				
			if(aroundDirection === "AroundLeft" || aroundDirection === "AroundUp"){
				document.getElementById('fieldColor').setAttribute(coordinate, valueFromInput);			
				document.getElementById('fieldLine').setAttribute(coordinate, valueFromInput);						
				document.getElementById('fieldLineIn').setAttribute(coordinate, valueFromInput);
			}else{
				document.getElementById('fieldColor').setAttribute(coordinate, opositeSpreadValue);			
				document.getElementById('fieldLine').setAttribute(coordinate, opositeSpreadValue);						
				document.getElementById('fieldLineIn').setAttribute(coordinate, opositeSpreadValue);
			}	
				
			calculateOptions();			
			
		}
			
