		//round and fix decimal places
		function round(value, exp) {
		  if (typeof exp === 'undefined' || +exp === 0)
			return Math.round(value);

		  value = +value;
		  exp = +exp;

		  if (isNaN(value) || !(typeof exp === 'number' && exp % 1 === 0))
			return NaN;

		  // Shift
		  value = value.toString().split('e');
		  value = Math.round(+(value[0] + 'e' + (value[1] ? (+value[1] + exp) : exp)));

		  // Shift back
		  value = value.toString().split('e');
		  return +(value[0] + 'e' + (value[1] ? (+value[1] - exp) : -exp));
		}
		
		//disabling all input elements with same class
		function disableAllElements(nameOfSliderClass, nameOfColorPickerClass) {
			
			$(nameOfColorPickerClass).spectrum("disable");
			
			var disabledInputs = document.querySelectorAll(nameOfSliderClass);
			var i;
			for (i = 0; i < disabledInputs.length; i++) {
				disabledInputs[i].disabled = true;
				disabledInputs[i].setAttribute("value", "0");
				disabledInputs[i].style.opacity = "0.4";
			}
		}
		
		function enableAllElements(nameOfSliderClass, nameOfColorPickerClass) {

			$(nameOfColorPickerClass).spectrum("enable");
			
			var enabledInputs = document.querySelectorAll(nameOfSliderClass);
			var i;
			for (i = 0; i < enabledInputs.length; i++) {
				enabledInputs[i].disabled = false;
				enabledInputs[i].style.opacity = "1";
			}
		}
	
