		/* Fence Switcher */
		function toggleFence() {
			var e = document.getElementById("selectEnvironment");
			var x = e.options[e.selectedIndex].value;
			var toggleLights = document.getElementById('togBtnLights').getAttribute("value");
			
			if (document.getElementById("togBtnFence").value == "on") {
				document.getElementById("togBtnFence").setAttribute("value", "off");
				if(x == "Indoor"){
					if(toggleLights == "off"){
						$('#container').css('background-image', 'url("img/inside.png")');	
					} else {
						$('#container').css('background-image', 'url("img/inside-night.png")');	
					}
				}else{
					if(toggleLights == "off"){
						$('#container').css('background-image', 'url("img/outside.png")');
					} else {
						$('#container').css('background-image', 'url("img/outside-night.png")');	
					}
				}					
			} else {
				document.getElementById("togBtnFence").setAttribute("value", "on");
				if(x == "Indoor"){					
					if(toggleLights == "off"){
						$('#container').css('background-image', 'url("img/inside.png"), url("img/fence-inside.png")');	
					} else {
						$('#container').css('background-image', 'url("img/fence-inside.png"), url("img/inside-night.png")');	
					}									
				}else{					
					if(toggleLights == "off"){
						$('#container').css('background-image', 'url("img/outside.png"), url("img/fence-outside.png")');	
					} else {
						$('#container').css('background-image', 'url("img/fence-outside.png"), url("img/outside-night.png")');	
					}
				}
			}
		}		
